import './App.scss';

// import { BrowserRouter, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>

      <header>
        <nav>
          <div>Laurie Villeton</div>
          <ul>
            <li>Projects</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>

      <article>
        <h1>Hi, I'm Laurie.</h1>
        <p>I am a full-stack web developer, currently based in Kamloops, BC. My toolbox includes React, JavaScript, HTML, CSS, Sass, Node, Express & MySQL. I am passionate about action sports and the outdoors.</p>
        <button>Learn More</button>
      </article>

    </div>
  );
}

export default App;
